import React from 'react';
import PropTypes from 'prop-types';
import './styles.css'
AudioItems.propTypes = {
    data: PropTypes.array,
};
AudioItems.default = {
    data: []
}

function AudioItems(props) {
    const { data } = props;
    console.log(data);
    return (
        <ul>
            {data.map((song) => {
                return <li key={song.id} className="song">
                    <img className="song-img" src={song.image} />
                    <span className="song-name">{song.name}</span>
                    <span className="song-aritst">{`- ${song.artist}`}</span>
                </li>;
            })}
        </ul>
    );
}

export default AudioItems;
